import React from "react";
import './index.css';
import Button from '@mui/material/Button';

const App = () => {
    return(
        <>
            <div className="container">

            <h1>ToDo List</h1>
            <div className="inputPlace">
                <input type="text" placeholder="Add an Item" />
                <Button size="small">Small</Button>
            </div>

            </div>
        </>
    )
};

export default App;
